    func sum1() -> Void {
        let nums = [-1,0,1,2,-1,-4]
        
        let result =  solution.threeSum(nums)
        print(result)
    }
    func sol3() -> Void {
        let str = "aba"// abccbde
        let result =  strSolution.longestPalindrome(str)
